import { render } from '@testing-library/react'
import React from 'react'
import DisplayDog from './DisplayDog';
import { useParams } from 'react-router-dom';


export const Dogs = (dogProps) => {
    let dogs = [];
    for (var i = 0 ; i<6 ; i++){
        dogs.push(<DisplayDog addToFav = {dogProps.addToFav}/>)
    };

    next = (e) => { 
        console.log ("KLIK")
    }
    

    return(
        <div className="dogs">
            <h1>Dogs</h1>
            {dogs}
            <div className="moreButton">
                <button type="button" onClick= {(e) => next()} className="btn btn-fav">Add</button>
            </div>
        </div>  

    )
}
